import logo from '../../img/logo.png';
import avatar from '../../img/logo.png';
import arrow_down from '../../img/arrow-down.png';
function Header(){
    const dropdown = {
        backgroundImage: '../../img/arrow-down.png',
        backgroundRepeat: 'no-repeat',
        width:"25px",
        height:"25px"
    }
    return (
        <div className="p-[50px] flex justify-between">
            <img src={logo} alt="" />
            <img src={avatar} alt="" className='rounded-full' width="75" height="75" />
            <div className="dropdown" style={dropdown}>

            </div>
        </div>    
    )
}

export default Header
